                public void actionPerformed(ActionEvent e) {
                    if (e.getActionCommand().equals("Yes"))
                        confirmRet = true;
                    else
                        confirmRet = false;
                    confirmDialog.setVisible(false);
                }
            });
            bp.add(noBut = new Button("No"));
